𝚆𝚎𝚕𝚌𝚘𝚖𝚎 𝚝𝚘 𝚜𝚖𝚊𝚕𝚕 𝚃𝚘𝚠𝚗! 

𝙰 𝚗𝚘𝚜𝚝𝚊𝚕𝚐𝚒𝚌 𝚓𝚘𝚞𝚛𝚗𝚎𝚢 𝚘𝚏 𝚊𝚕𝚕 𝚝𝚑𝚒𝚗𝚐𝚜 𝚜𝚖𝚊𝚕𝚕 𝚃𝚘𝚠𝚗.

𝙵𝚘𝚛 𝚝𝚑𝚘𝚜𝚎 𝚠𝚑𝚘 𝚍𝚘𝚗𝚝 𝚔𝚗𝚘𝚠 𝚞𝚜 𝚢𝚎𝚝, 𝚢𝚘𝚞 𝚠𝚒𝚕𝚕. 

𝙵𝚘𝚛 𝚝𝚑𝚘𝚜𝚎 𝚠𝚑𝚘 𝚍𝚘, 𝚠𝚎 𝚕𝚘𝚟𝚎 𝚢𝚘𝚞. 

𝙷𝚊𝚙𝚙𝚢 𝚗𝚎𝚠 𝚢𝚎𝚊𝚛𝚜 𝚝𝚘 𝚗𝚎𝚠 𝚊𝚍𝚟𝚎𝚗𝚝𝚞𝚛𝚎𝚜! 

